import React from 'react'
import Seat from './Seat'

const Seats = () => {
    const [seats, setSeats] = useState([
        {
            pnr: 'F1234',
            available: true,
            price: 120
        },
        {
            pnr: 'B1234',
            available: true,
            price: 100
        },
        {
            pnr: 'E1234',
            available: true,
            price: 80
        }
    ])
    return (
        <>
        { seats.map((seat) => (
            <Seat key={ seat.pnr } seat={ seat } onToggle={toggleSeat}/>
        ))}
        </>

    )
}

const toggleSeat = (pnr) => {
    console.log(pnr)
}
export default Seats
